import React, { Component } from 'react';


export default class Debug extends Component {


    select = (filename) => {
		console.log(filename);
		this.props.filename(filename);
	};

	render() {
		return (
			<div>
                <div className='title'>Debug</div>
                {this.props.state.map((data, i) => (
                    <div key={i}>
                        <button>{data}</button>
                    </div>
                ))}
			</div>
		);
	}
}
